import "./style.css";
import { linkDinSvg, instSvg, gitHubSvg, linkDinSvgActive, instSvgActive, gitHubSvgActive } from "../../../../svg/HeaderSvg";

export default function HeaderMenu() {

  const [isHover, setHover] = React.useState({ln: false, git: false, inst: false })

    return (
      <div className="header-menu">
      <div>
        <p>
          Onigiri_King
        </p>
      </div>
        <div className="nav-links">
          <p>Home</p>
          <p>About</p>
          <p>Works</p>
        </div>
        <div className="sm-links">
          <a href="https://www.linkedin.com/in/onigiriking/" target="_blank">
            {!isHover.ln?linkDinSvg:linkDinSvgActive}
          </a>
          <a href="https://github.com/OnigiriKing" target="_blank">
            {gitHubSvg}
          </a>
          <a href="https://www.instagram.com/onigiri_king/" target="_blank">
            {instSvg}
          </a>
        </div>
      </div>
    );
}
